'use strict'
import React from 'react'

 class General extends React.Component {
  constructor (props) {
    super(props)
    this.state = { 
      fromCompletedBy: '', 
      GPSProduct: ''
    }
    this.handleChange = this.handleChange.bind(this);
  }

  handleChange (event) {
    this.setState({[event.target.name]: event.target.value})
  }

  render () {
    return (
      <div>
        <div className='row'>
          <div className='six columns'>
            <label>From Completed By</label>
            <input
              className='u-full-width'
              placeholder='From Completed By'
              type='text'
              onChange={this.handleChange}
              value={this.state.fromCompletedBy}
              autoFocus
            />
          </div>
        </div>
        <div className='row'>
          <div className='six columns'>
            <label> GPS Product</label>
            <input
              className='u-full-width'
              placeholder='Last Name'
              type='text'
              onChange={this.handleChange}
              value={this.state.GPSProduct}
            />
          </div>
        </div>
        <div className='row'>
          <div className='six columns'>
            <label>Last Name</label>
            <input
              className='u-full-width'
              placeholder='Last Name'
              type='text'
              onChange={this.handleLastNameChanged}
              value={this.state.lastName}
            />
          </div>
        </div>
      </div>
    )
  }
}
export default General;
